import React from 'react';
import ReactDOM from 'react-dom/client';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../../../Project_final/content-analytics/frontend/src/assets/css/styles.css';
import App from '../../../../Project_final/content-analytics/frontend/src/App';

// Create a root using the new API for React 18
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
